/*Table structure for table `acknowledgment` */

DROP TABLE IF EXISTS `acknowledgment`;

CREATE TABLE `acknowledgment` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `submission_id` int(255) DEFAULT NULL,
  `control_no` varchar(50) DEFAULT NULL,
  `recipient_name` varchar(100) DEFAULT NULL,
  `recipient_designation` varchar(100) DEFAULT NULL,
  `recipient_office` text DEFAULT NULL,
  `recipient_address` text DEFAULT NULL,
  `findings` text DEFAULT NULL,
  `action_taken` text DEFAULT NULL,
  `acknowledged_by` int(255) DEFAULT NULL,
  `date_acknowledged` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `FK_acknowledgment_submission` (`submission_id`),
  CONSTRAINT `FK_acknowledgment_submission` FOREIGN KEY (`submission_id`) REFERENCES `submission` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=99 DEFAULT CHARSET=utf8mb4;

/*Data for the table `acknowledgment` */

insert  into `acknowledgment`(`id`,`submission_id`,`control_no`,`recipient_name`,`recipient_designation`,`recipient_office`,`recipient_address`,`findings`,`action_taken`,`acknowledged_by`,`date_acknowledged`) values (9,45,'NEDARO1-QOP-03-20220011','Dennis D. Andres','Regional Director','Philippine Coconut Authority','2nd Flr Guesthouse Building, PCA Cmpd, Elliptical Rd, Quezon City','<p>1. Two&nbsp;projects&nbsp;enrolled in the eRPMES five working days before the deadline.</p>\r\n\r\n<p>2. Project #1. Please transfer outcomes #2 -4 under outputs. Also, please update the timeline of outcome #1: increased coconut yield to consider at least one cropping season to realize the expected increase in yield.</p>\r\n\r\n<p>3. Project #2. Please revisit the performance indicator and target under the outcome of the project. If the expected outcome is increased area of production, the indicator should be number of hectares.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-05-30 18:16:59'),(10,54,'NEDARO1-QOP-03-202200110','Eugene G. Cabrera, CESE','Regional Director','Office of Civil Defense','San Fernando City, La Union','<p>1. 21 projects enrolled one working day before the deadline.</p>\r\n\r\n<p>2. On Projects #1 and #5, please change the indicator from the word &#39;percentage&#39; to the symbol &#39;%&#39; for proper computation and organization of data.&nbsp;</p>\r\n\r\n<p>3. With regard to Project #1, since the target beneficiaries are the LGUs, please input the number under the &#39;group&#39; section and indicate &#39;LGUs&#39; on the box beside it, instead of inputting the number of beneficiaries under the individual section.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-05-31 14:47:51'),(11,30,'NEDARO1-QOP-03-202200111','Maria Dorica Naz-Hipe','Regional Director','Environmental Management Bureau','San Fernando City, La Union','<p>1. 8 projects enrolled 4&nbsp;days before the deadline.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-06-01 11:01:44'),(12,27,'NEDARO1-QOP-03-202200112','Jeremias C. Singson','Provincial Governor','Provincial Government of Ilocos Sur','Vigan City, Ilocos Sur','<p>1.&nbsp;Four projects&nbsp;enrolled in the eRPMES four working days before the deadline.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-01 17:53:47'),(13,100,'NEDARO1-QOP-03-202200113','Raul A. Servito','Regional Director','Philippine Crop Insurance Corporation','San Fernando City, La Union','<p>1. One&nbsp;project enrolled in the eRPMES one day before the deadline.&nbsp;</p>\r\n\r\n<p>2. The attachment uploaded does not contain the profile of the project. Please upload the accomplished project profile.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-01 17:58:58'),(14,44,'NEDARO1-QOP-03-202200114','Gilbert R. Arce','SUC President','Ilocos Sur Polytechnic State College','Sta. Maria, Ilocos Sur','<p>1. Six projects enrolled in the eRPMES two working days before the deadline.</p>\r\n\r\n<p>2. Three out of six are carry-over projects.&nbsp;</p>\r\n\r\n<p>3. All projects&nbsp;listed in the Regional Development Investment Program (RDIP) were enrolled in the eRPMES comprising of 100% funded amount (PHP 20M). &nbsp;&nbsp;</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-02 11:18:30'),(15,47,'NEDARO1-QOP-03-202200115','Robert Victor G. Seares, Jr','Administrator','National Tobacco Administration','Panay Ave. cor Scout Reyes St., Quezon City','<p>1. Eleven projects enrolled in the eRPMES three working days before the deadline.</p>\r\n\r\n<p>2. Six out of the 20 programs and projects (PAPs) funded for CY 2022 were enrolled in the eRPMES comprising 14.32 percent of the total funded amount. May we inquire about the reasons for the non-inclusion of some of the projects in the eRPMES. Also attached is the submitted list of NTA&rsquo;s FY 2022 funded PPAs in comparison to the actual PAPs enrolled in the eRPMES for your reference.</p>\r\n\r\n<p>For PAPs&nbsp;in the AIP needing revisions or updates, please email the updated list to <a href=\"mailto:nro1@neda.gov.ph\">nro1@neda.gov.ph</a> c/o the Project Development Investment, Programming and Budgeting Division (PDIPBD).</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-02 13:46:51'),(16,28,'NEDARO1-QOP-03-202200116','Armando Q. Ganal','Regional Director','Department of Science and Technology','San Fernando City, La Union','<p>1. Five projects enrolled in the eRPMES on the day of the deadline.</p>\r\n\r\n<p>2. Three out of the 12 programs and projects (PAPs) funded for FY 2022 were enrolled in the eRPMES comprising of 50 percent of the total funded amount. May we inquire about the reasons for the non-inclusion of some of the projects in the eRPMES in addition to those mentioned in the previous year, as applicable. Also attached is the submitted list of DOST&rsquo;s FY 2022 funded PPAs in comparison to the actual PAPs enrolled in the eRPMES, for your reference.</p>\r\n\r\n<p>3. For PPAs in the AIP needing revisions or updates, please email the updated list to <a href=\"mailto:nro1@neda.gov.ph\">nro1@neda.gov.ph</a> c/o the Project Development Investment Programming Division (PDIPBD).</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-03 10:29:52'),(17,25,'NEDARO1-QOP-03-202200117','Danilo B. Bose','Officer-In-Charge','North Luzon Philippines State College','Candon City, Ilocos Sur','<p>1. Four projects enrolled in the eRPMES on the day of the deadline.</p>\r\n\r\n<p>2. Two out of four are carry -over projects.</p>\r\n\r\n<p>3. wo out of the eight programs and projects (PAPs) funded for CY 2022 were enrolled in the eRPMES comprising of 3.49 percent of the total funded amount. May we inquire about the reasons for the non-inclusion of some of the projects in the eRPMES. Also attached is the submitted list of NLPSC&rsquo;s FY 2022 funded PPAs in comparison to the actual PAPs enrolled in the eRPMES for your reference.</p>\r\n\r\n<p>4. Project #: Construction of WASH area. The total financial allocation enrolled in the eRPMES is more than the indicated amount in the list of funded FY 2022 PAPs (PhP 2.8M vs PhP 2M). Please clarify or make the necessary adjustment.</p>\r\n\r\n<p>5. For PPAs in the AIP needing revisions or updates, please email the updated list to <a href=\"mailto:nro1@neda.gov.ph\">nro1@neda.gov.ph</a> c/o the Project Development Investment Programming Division (PDIPBD)</p>\r\n','<p>For consideration in the preparation of the CY 2022 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-03 10:57:41'),(18,52,'NEDARO1-QOP-03-202200118','Dennis D. Andres','Regional Director','Philippine Coconut Authority','2nd Flr Guesthouse Building, PCA Cmpd, Elliptical Rd, Quezon City','<p>1. The two projects enrolled in the eRPMES were all included in the Accomplishment Report which was submitted three working days before the deadline.</p>\r\n\r\n<p>2. All projects have not yet started.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q1 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-06-03 11:0