ion in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',6,'2022-07-19 09:14:41'),(86,173,'NEDARO1-QOP-03-202200186','Maria Belinda V. Sevalla','OIC-Regional Manager','National Housing Authority','Session Road, Baguio City','<p>1. Five enrolled projects were included in the Q2 Accomplishment Report which was submitted&nbsp;on the set deadline.</p>\r\n\r\n<p>2. All 5 projects were already ongoing.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',7,'2022-07-19 09:54:18'),(87,182,'NEDARO1-QOP-03-202200187','Evelyn R. Ramos','Regional Director','Department of Labor and Employment','San Fernando City, La Union','<p>1. Three enrolled projects were included in the Q2 accomplishment report submitted on the set deadline.</p>\r\n\r\n<p>2. The 3 projects were already ongoing.</p>\r\n\r\n<p>3. Two projects&nbsp;are ahead of schedule, while 1 is delayed.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',7,'2022-07-19 10:01:48'),(88,77,'NEDARO1-QOP-03-202200188','Magno A. Wailan','Municipal Mayor','Municipal Government Unit of Santol','Santol, La Union','<p>1. 2 project/s enrolled 3 days before deadline</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q1 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',6,'2022-07-19 10:43:54'),(89,175,'NEDARO1-QOP-03-202200189','Primo C. Lara','Regional Director','Department of Agrarian Reform','San Fernando City, La Union','<p>1. The 25 projects enrolled in the eRPMES were all included in the Accomplishment Report which was submitted on the day of&nbsp;the deadline.</p>\r\n\r\n<p>2. Four projects incurred negative slippages of more than 15 percent while 15 projects registered positive slippages of above 15 percent. Please accomplish the RPMES Form 3 (Project Exception Report).</p>\r\n\r\n<p>3. Projects #1, #4, #5, #6,&nbsp;#7, #8, #9, #14, and 16&nbsp;with obligation and disbursement greater than the allocation and releases. Please revisit data entries and make the necessary adjustments</p>\r\n\r\n<p>4. Project #3 (Land Acquisition and Distribution &ndash; Land Valuation) with reported physical accomplishment but no corresponding financial accomplishment. Please clarify or make the necessary adjustment.</p>\r\n\r\n<p>5. Projects #10, #11, #12, #13, #18, #19, &nbsp;#23, #24, and #25 with physical accomplishments higher than their targets but with low financial accomplishments reported. Please clarify or make the necessary adjustments.&nbsp;</p>\r\n\r\n<p>6. The unit of measure and physical target for the &ldquo;Resolution of Agrarian Law Implementation Cases - ALI Resolution of Cases&rdquo; project as discussed during the project validation in June 2022 was not yet updated. Please adjust accordingly.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Report.&nbsp;</p>\r\n',8,'2022-07-19 11:07:54'),(90,184,'NEDARO1-QOP-03-202200190','Vincent Aljon A. Cifra','Regional Director','Technical Education and Skills Development Authority','San Fernando City, La Union','<p>1. Two enrolled projects were included in the Q2 accomplishment report submitted on the set deadline.</p>\r\n\r\n<p>2. Project is delayed, and the other project is implemented ahead of time.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',7,'2022-07-19 11:35:52'),(91,189,'NEDARO1-QOP-03-202200191','Raul A. Servito','Regional Director','Philippine Crop Insurance Corporation','San Fernando City, La Union','<p>1. The sole project enrolled in the eRPMES was&nbsp;included in the Accomplishment Report which was submitted one working day after&nbsp;the deadline.</p>\r\n\r\n<p>2. The project incurred a negative slippage of 24 percent as of Q2. As explained in the remarks column of the RPMES Form 2, the low accomplishment was due to the delayed planting season of the farmers. Also, please accomplish RPMES Form 3 (Project Exception Report) to capture&nbsp;the additional details of the delayed project.</p>\r\n\r\n<p>3. The reported number of persons employed as of Q2 is quite higher than the target and said number is equal to the number of farmers who benefitted. Please clarify or make the necessary adjustments whether the reported data is indeed the additional employment generated or&nbsp;the actual number of beneficiaries. &nbsp;</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Report.&nbsp;</p>\r\n',8,'2022-07-19 11:57:03'),(92,193,'NEDARO1-QOP-03-202200192','Erma R. Yapit','Regional Director','Commission on Population and Development','San Fernando City, La Union','<p>1. Three enrolled projects were included in the Q2 accomplishment report.</p>\r\n\r\n<p>2. All projects have higher releases than allocation. Please provide reason for this through the remarks section of the accomplishment report form.</p>\r\n\r\n<p>3. The Responsible Parenthood and Family Planning (RPFP) and Population and Development Integration (PDI) programs incurred positive slippage of 1240 percent and 813.33 percent, respectively. Kindly provide possible reasons/causes for the outstanding accomplishments as well as recommendations to sustain these through Form 3 (Project Exception Report).</p>\r\n\r\n<p>4. The Adolescent Health Development (AHD) Program incurred a negative slippage of 16.73 percent. Please state the possible reasons/causes for the lower than target physical accomplishment and provide recommendations to improve work progress through Form 3 (Project Exception Report).</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',7,'2022-07-19 13:08:10'),(93,105,'NEDARO1-QOP-03-202200193','Maria Dorica Naz-Hipe','Regional Director','Environmental Management Bureau','San Fernando City, La Union','<p>1. The eight projects enrolled in the eRPMES were all included in the Accomplishment Report submitted on the deadline.</p>\r\n\r\n<p>2. All of the enrolled projects are ongoing, four of which were implemented on time while the remaining four were behind schedule.</p>\r\n\r\n<p>3. Please provide reasons why four of the enrolled projects were behind schedule.</p>\r\n\r\n<p>4. The fund utilization rate as of the 1st Quarter was 42.05%. Please provide reasons behind this figure.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Acknowledged on June 1, 2022</em></p>\r\n','<p>For consideration in the preparation of the CY 2022 Q1 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-07-19 14:26:55'),(94,150,'NEDARO1-QOP-03-202200194','Socrates G. Gaerlan','Regional Director','Mines and Geosciences Bureau- Regional Office No. I','San Fernando City, La Union','<p>1. The five projects enrolled in the eRPMES were included in the Accomplishment Report submitted three working days after the deadline.</p>\r\n\r\n<p>2. Three projects were already ongoing and implemented on time as of the 1st Quarter.</p>\r\n\r\n<p>3. The remaining two projects will be implemented in the succeeding quarters.</p>\r\n\r\n<p>4. Fund utilization rate for projects enrolled under the DRRM category was recorded to be 56.26%. Please provide reasons behind this figure.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Acknowledged on June 7, 2022.</em></p>\r\n','<p>For consideration in the preparation of the CY 2022 Q1 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-07-19 14:32:21'),(95,56,'NEDARO1-QOP-03-202200195','Eugene G. Cabrera, CESE','Regional Director','Office of Civil Defense','San Fernando City, La Union','<p>1. The 21 projects enrolled in the eRPMES were included in the Accomplishment Report submitted five working days before the deadline.</p>\r\n\r\n<p>2. Eight projects were implemented as of the 1st Quarter.</p>\r\n\r\n<p>3. Seven projects were already completed and one was ongoing and implemented on time.</p>\r\n\r\n<p>4. Physical performance for the 1st Quarter was recorded to have a negative slippage of 7.04 percent. Please provide reasons behind this figure.</p>\r\n\r\n<p>5. Target number of beneficiaries for Q1 was 780 individuals but actual beneficiaries was 280 individuals. Please clarify.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Acknowledged on June 1, 2022</em></p>\r\n','<p>For consideration in the preparation of the CY 2022 Q1 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-07-19 17:38:26'),(96,195,'NEDARO1-QOP-03-202200196','Gilbert R. Arce','SUC President','Ilocos Sur Polytechnic State College','Sta. Maria, Ilocos Sur','<p>1. The six projects enrolled in the eRPMES were all included in the Accomplishment Report which was submitted two working days after&nbsp;the deadline.</p>\r\n\r\n<p>2. All four ongoing projects (#1, #2, #3, and #4) were implemented ahead of schedule. Please provide reason/s for the high&nbsp;accomplishments of the four projects.</p>\r\n\r\n<p>3.&nbsp; Projects #2, #3, and #4&nbsp;were implemented ahead of schedule but with low financial accomplishments reported. Please clarify or make the necessary adjustments.</p>\r\n\r\n<p>4. Project #4 with reported number of employment generated twice the target. Please clarify or make the necessary adjustments.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',8,'2022-07-20 15:46:08'),(97,201,'NEDARO1-QOP-03-202200197','Gaudencio M. De Vera, MBA','Acting Regional Irrigation Manager','National Irrigation Administration','Urdaneta City, Pangasinan','<p>1. All projects were programmed to start on Q3.&nbsp;</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',6,'2022-07-22 09:24:39'),(98,176,'NEDARO1-QOP-03-202200198','Crizaldy M. Barcelo, CESO III','Regional Executive Director','Department of Environment and Natural Resources','San Fernando City, La Union','<p>1. The six projects enrolled in the eRPMES were all included in the Accomplishment Report which was submitted on the day of the deadline.</p>\r\n\r\n<p>2. Two projects were implemented ahead of schedule.</p>\r\n\r\n<p>3. On Project #1, the target group beneficiaries was 59, however, the actual group beneficiaries is 0. Please provide reason/s behind this.</p>\r\n\r\n<p>4. On Project #5, the amount of releases is relatively lower than the allocated amount despite implementing the project ahead of schedule. Please clarify.</p>\r\n\r\n<p>5. On Project #6, the releases, obligation, and disbursement were higher than allocated amount by Php 1,000. Please clarify.</p>\r\n','<p>For consideration in the preparation of the CY 2022 Q2 Regional Project Monitoring and Evaluation System (RPMES) Project Monitoring Plan.</p>\r\n',5,'2022-07-22 15:21:25');

