i.e., built-up areas, population/people and road networks) to rain-induced landslide and flood hazards in a particular area. Furthermore, it aims to understand the different dimensions of vulnerability, to wit; physical, social, economic, and environmental aspects. \r\n\r\n\r\nThe outputs of the VRA consist of risk exposure maps which contain information on the overall exposure of elements at risk to a specific hazard in an area. The completed risk exposure maps may be used as inputs to the regional, provincial, and local disaster preparedness, management and mitigation plans as well as land use plans. \r\n',2,7,NULL,2,'',4,'','Default','Current Year','2022-03-01','2022-10-31',74,'2022-05-24 13:43:31','No',NULL),(235,NULL,'EMB-22-0003',2022,34,72,'Industrial Compliance Monitoring','',2,6,NULL,2,NULL,5,'','Default','Current Year','2022-01-01','2022-12-31',11,'2022-05-24 13:43:56','No',NULL),(236,NULL,'',2022,39,NULL,'Rehabilitation of Amburayan River Control ','Barangay Consuegra to Barangay Alzate',4,16,NULL,1,'',3,'','Default','Current Year','2022-02-23','2022-10-11',43,'2022-05-24 13:44:54','Yes',NULL),(238,NULL,'R1MC-22-0001',2022,71,NULL,'Construction of Proposed 15 Bed Veterans WArd Bldg.','In 2021 the D.O.H. sent letter to R1MC to prepare a lot or structure that will fit to erect or convert it into a veterans ward. Since the area of main R1MC compound is full of structures there’s no more portion that is vacant to use for the project that we studied all buildings possible for additional vertical expansion and we decided to check the integrity and soundness of the one storey Engineering Building. We found out that the foundations, columns and beams can support to have three floors. Then we prepares structural investigation computations and structural analysis computations and detailed estimate and program of works including drawing and sketches approved by R1MC and DOH. The project will be the additional second floor of the Engineering Maintenance building cont