ord the cost of hospitalization. Hence, the availability of these medical equipment plays a vital role in Moreover, they will no longer have to go to private hospitals for their treatment and medication. Proposed equipment is also responsive to new health care challenges encountered by the hospital and addresses the growing demand for healthcare services in the Region. \r\n\r\nThe establishment/strengthening of the hospital’s Eye Center is critical in achieving our vision and positioning ITRMC as \"A People-centered Multi-specialty Regional Medical Center Delivering Quality Health Services, Training, and Research in the Ilocos Region by 2025.\"\r\n\r\n',4,32,NULL,1,'',4,'','Default','Current Year','2022-05-24','2022-10-31',48,'2022-05-24 14:21:21','No',NULL),(293,NULL,'NHA-22-0001',2022,51,NULL,'Land Development and Construction of 54 Housing Units for Infanta Resettlement Project','Resettlement Assistance Program for Local Government Units',5,20,NULL,1,'',4,'','Cumulative','Carry-Over','2021-08-15','2022-10-15',19,'2022-05-24 14:22:27','No',NULL),(296,NULL,'NTA-22-0003',2022,54,NULL,'Curing Barn Assistance Project','',3,26,NULL,2,NULL,10,'','Default','Current Year','2022-10-31','2023-02-28',23,'2022-05-24 14:22:53','No',NULL),(298,NULL,'ISPSC-22-0001',2022,35,NULL,'Enhancement of Food Processing Center with Equipment','To enhance a Food Processing Center building with UV rooms, sensory evaluation rooms and offices provided with equipment.',4,32,NULL,1,NULL,3,'','Cumulative','Current Year','2022-06-01','2022-11-27',67,'2022-06-02 11:43:04','No',NULL),(301,NULL,'BJMP-22-0002',2022,8,NULL,'Installation of Isolation Facility at Batac District Jail','A one storey building with three rooms and receiving area for  covid-19 patients',4,24,NULL,1,'',3,'','Cumulative','Current Year','2022-06-16','2022-09-12',4,'2022-06-23 14:07:16','No',NULL),(303,NULL,'NHA-22-0002',2022,51,NULL,'Land Development and Construction of 57 Housing Units for San Fabian Resettlement Project','Land