y Multidisciplinary OPD Tower (Phase II) as an infrastructure support to be a Regional HUB for specialists and subspecialists care. The healthcare infrastructure project aims to improve the hospital\'s standard of care and well-being for all stakeholders, together with a good experience of the health care system, as the hospital (ITRMC) envision to be a responsive multi-specialty APEX Hospital in the next 5-years. The project will also address the growing demand for healthcare services as the hospital plays the main referral facility for 1.5M inhabitants, mostly from the Province of La Union.\r\n\r\nThe Outpatient department of any hospital is one of the first point of contact for patient seeking consult. The emergency department being the other. As one of the first point of contact, it makes or breaks the image of the hospital. The Outpatient department is a place for health promotion and disease prevention. A good outpatient services can reduce the load in the inpatient services. A better trade in because treatment at the outpatient department is substantially less expensive compared to inpatient services. Aside from that it contributes to the reduction of morbidity and mortality.\r\n\r\nDuring pre-pandemic, we had seen a constant increase in the number of consultations provided to clients coming from La Union, Ilocos Sur, Pangasinan and even from Abra. In order to meet this growing need and demand, there is a dire need to build a bigger space to accommodate the number of clients. Also, there is the need for additional space that would encompass the services for clients as well as space much needed for the improvement we are envisioning to provide. With the present situation where space has become a premium to observe physical distancing to meet minimum health standards, this is a must for us considering our present space. Space has now been the major limiting factor for us to cater our clients. Outpatient consult has significantly decrease because of this. We would want to cater to more clients however we can’t sacrifice the safety of everyone, clients and staff alike.\r\n\r\nThe completion of the outpatient building the soonest possible time will mean more clients served, better services offered, eventually better a health outcome, a healthier community. A health community may translate to a lesser expense for the government in terms of health provisions for its people, a more productive community, which maybe the driver for our economy to thrive even more. These all means a better Philippines for everyone.\r\n',4,32,NULL,1,'',4,'','Cumulative','Current Year','2022-10-01','2024-03-31',48,'2022-05-24 15:58:29','No',NULL),(337,NULL,'PG-Pang-22-0009',2022,70,NULL,'Construction of Cold Storage Building with Generator House','',4,2,NULL,1,'',39,'','Cumulative','Current Year','2022-03-10','2022-10-20',39,'2022-05-24 16:02:10','No',NULL),(340,NULL,'NHA-22-0005',2022,51,NULL,'Pilgrim Heights Residences','Land Development and Construction of 375 Housing Units under the project being implemented thru Community-Based Initiative Approach',5,20,NULL,1,'',4,'','Cumulative','Carry-Over','2021-09-30','2022-09-24',19,'2022-05-24 16:13:32','No',NULL),(344,NULL,'PPMC-22-0006',2022,66,NULL,'Construction of Additional Drainage at the San Fernando Airport','Provision of additional drainage at the San Fernando\r\nAirport.',4,3,NULL,1,'',11,'','Cumulative','Carry-Over','2021-09-22','2022-03-05',24,'2022-05-24 16:15:27','No',NULL),(345,NULL,'NNC-22-0003',2022,53,NULL,'Nutrition Shepherding in Region I','The Nutrition Shepherding Project is a platform that involves guiding and mentoring low-performing LGUs by a regional nutrition shepherding team to enhance their knowledge and skills on nutrition program management.',5,19,NULL,2,NULL,4,'','Maintained','Current Year','2022-04-01','2022-12-31',36,'2022-07-19 20:44:06','No',NULL),(346,NULL,'',2022,69,NULL,'Rehabilitation of Poblacion East Hanging Bridge','The project is a 90 meters footbridge that cat