be awarded with said equipment and has the option to impose payment/rate for the use of the said machines/equipment for the FCAs to have income and also for the maintenance of the machines/equipment.',1,9,NULL,2,'',5,'','Default','Current Year','2022-08-01','2022-08-31',97,'2022-06-03 17:44:17','No',NULL),(497,NULL,'',2022,NULL,NULL,'Trainings and Seminars - SSF','MSMEs are considered growth engines of the Philippine economy.  However, performance of MSMEs is constrained by various factors such as limited financial capacity, poor market information and lack of access to innovative techniques and advanced technology which hinder them to realize their full potential, break into bigger domestic or international markets, and grow in a highly competitive environment.  To address these challenges, the MSME Development Plan was drawn to ensure that programs are made available to address key pain points and strengthen MSME growth.  One of the programs identified under the Plan is the Shared Service Facilities (SSF) Project, a flagship project of the Department of Trade and Industry aimed at improving MSME productivity and efficiency through better access to technology.\r\n\r\nSSF Project is meant to improve MSME competitiveness by providing machinery, equipment, tools, systems, accessories, and other auxiliary items, skills, and knowledge under a shared system.  The facilities should help target beneficiaries increase their production capacities and improve product quality, resulting in increased markets, increased sales, and jobs generation.  SSF is a public-private partnership initiative being implemented through cooperators who can house the machinery and equipment and make these accessible to MSMEs.',1,36,NULL,2,'',5,'','','Current Year','2022-01-01','2022-12-31',NULL,'2022-05-25 16:53:16','Yes',NULL),(498,NULL,'DA-22-0075',2022,22,4,'Various Seeds Distribution Program- Distribution of Lowland Vegetables Seeds','The project covers the distribution of quality vegetable, shallot and red onion seeds to high value crop farmers’ association engaged in vegetable and onion farming. The association has the option to impose payment of the seeds to the member-beneficiaries and collected payments by the association shall be use to procure vegetable/onion seeds for succeeding farmer-beneficiaries to ensure sustainability of the project.',1,9,NULL,2,'',5,'','Default','Current Year','2022-05-01','2022-05-31',97,'2022-06-03 17:43:13','No',NULL),(500,NULL,'DA-22-0075',2022,22,4,'Various Seeds Distribution Program- Distribution of Shallot','The project covers the distribution of quality vegetable, shallot and red onion seeds to high value crop farmers’ association engaged in vegetable and onion farming. The association has the option to impose payment of the seeds to the member-beneficiaries and collected payments by the association shall be use to procure vegetable/onion seeds for succeeding farmer-beneficiaries to ensure sustainability of the project.',1,9,NULL,2,'',5,'','Default','Current Year','2022-09-01','2022-09-30',97,'2022-06-03 17:37:39','No',NULL),(501,NULL,'DA-22-0075',2022,22,4,'Various Seeds Distribution Program- Distribution of Red Onions','The project covers the distribution of quality vegetable, shallot and red onion seeds to high value crop farmers’ association engaged in vegetable and onion farming. The association has the option to impose payment of the seeds to the member-beneficiaries and collected payments by the association shall be use to procure vegetable/onion seeds for succeeding farmer-beneficiaries to ensure sustainability of the project.',1,9,NULL,2,'',5,'','Default','Current Year','2022-09-01','2022-09-30',97,'2022-06-03 17:28:34','No',NULL),(502,NULL,'DA-22-0073',2022,22,NULL,'Yellow Corn Seed Assistance Program','The project covers the distribution of quality yellow corn seeds-GM to corn cluster organization engaged in corn farming. Each farmer-beneficiary within the cluster shall receive 9 kilograms or 1 bag GM Yellow Corn Seeds good for half hectare. The beneficiary shall pay the half of the cost of the seeds to the organization after harvest and the payments shall be use to procure corn seeds for succeeding farmer-beneficiaries within the cluster (roll-over scheme).',1,9,NULL,2,'',5,'','Default','Current Year','2022-06-01','2022-06-30',97,'2022-06-03 17:27:35','No',NULL),(507,NULL,'BFAR-22-0009',2022,3,79,'Balik Sigla sa Ilog at Lawa (BASIL)','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-12-31',12,'2022-05-26 10:13:49','No',NULL),(508,NULL,'BFAR-22-0010',2022,3,79,'Establishment/Deployment of Artificial Reef','',1,15,NULL,2,'',5,'','Default','Current Year','2022-10-01','2022-12-31',12,'2022-05-26 10:22:23','No',NULL),(509,NULL,'BFAR-22-0011',2022,3,79,'Mangrove Population Enhancement Program','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-03-31',12,'2022-05-26 10:50:25','No',NULL),(511,NULL,'DTI-22-0001',2022,32,14,'SSF Coffee Processing Development Project in Bagulin, La Union ','Coffee production in Bagulin was intially for home consumption. The provision of the planting materials provided under the National Greening Program of the DENR  encouraged  the coffee farmers to grow more.\r\n\r\nBarangay Libbo is one major coffee producing barangays of the municipality,  and the other barangays of Tio-angan, Dagup and Cardiz started  growing coffee too.  An estimated 14,825 coffee trees  are grown over 41.555 hectares in the municipality.  A growing number of farmers want to plant trees realizing the potential of coffee as in income earner.  The provision of  capability building activities on coffee production management and business opportunities provided by the Department of Trade and Industry,in partnership with the PhilCafe/ DOST and marketing assistance , i,e. market matching with El Union Coffee  made the coffee producers realized  more income opportunities for growing coffee. Being  a priority industry and commodity, convergence of assistance is expected from the DA, the PGLU which included Bagulin area among the coffee corridors in the Province of La Union. Noteworthy also,  the support of the Local Government Unit of Bagulin in  providing assistance thru its Municipal Agriculture Office  to actively assist in value adding to this prime commodity  for increased productivity.   More so, LGU Bagulin assist the coffee association thru its accreditation  for inclusive in budget supplementals for its enhancement.  With the provision of coffee processing equipment under the Shared Service Facility(SSF) Project of the Department of Trade and Industry lies the prime objective to produce the La Union homegrown quality grade coffee and to be able to reach a wider market outside of the Region, in general.',1,36,NULL,1,NULL,5,'','Default','Carry-Over','2021-01-01','2022-09-30',75,'2022-05-26 10:55:28','No',NULL),(512,NULL,'BFAR-22-0021',2022,3,79,'Establishment of fisheries sanctuaries/reserve/refuge','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-12-31',12,'2022-05-26 11:00:19','No',NULL),(513,NULL,'DTI-22-0002',2022,32,14,'SSF on Buffalo Milk Development Project','Carabao dairying is now a booming industry in the Philippines because it  is one of the sources of income for many local farmers. Their most popular carabao milk products are pasturized plain milk, choco milk, and yogurt milk. \r\n\r\nCarabao milk is known to be a nutritional powerhouse as it is low in cholesterol and high in calcium, some dubbed it as the most complete food. Carabao’s milk is more nutritious because it has 58 percent more calcium, 40 percent more protein, and 43 percent less cholesterol.  Its Vitamin A content is good for clearing eyesight while Vitamin D, calcium and phosphorus are valuable for strong teeth and bones. It is a superfood plus buying this supports our local farmers.\r\n\r\nKnowing these healthy benefits from the carabao milk, the Ilocano Artificial Inseminators Agriculture Cooperative ventured on this kind of industry. They distributed buffalo carabao to farmer recipients in the towns of Marcos, Bangui and Dingras, Ilocos Norte. The cooperative buys the harvested carabao milk from the farmers in these three towns and process the harvested carabao milk. Their existing markets today are the DSWD and DepEd feeding Program and entrepreneurs who sell milk yogurt milk, choco milk and plain milk.\r\n\r\nAt present, the members collect the carabao milk through the traditional hand milking process. This results to longer milking time and inconsistent milk volumes.\r\nThe requested milking machine shall reduce the milking time and the labor requirement for milking each carabao. This will increase the member’s productivity, efficiency and production quality.  \r\n\r\nThe project shall benefit the members of the Ilocano Artificial Inseminators Agriculture Cooperative as well as other MSMEs in the municipalities of Dingras, Marcos and Bangui, Ilocos Norte. \r\n\r\nIn support of the government’s Balik Probinsya, Bagong Pag-asa Program (BP2), the proposed SSF is open for individuals that have been displaced from their work and have returned in the province for good to provide them with employment and income opportunity. The facility once established and operational shall be used by the target beneficiaries to restart their life anew and rebuild their economic well-being.\r\n\r\nThe Ilocano Artificial Inseminators Agriculture Cooperative earnestly seek the assistance of the Department of Trade and Industry to provide machineries and equipment for the carabao milk industry.\r\n',1,36,NULL,1,NULL,5,'','Default','Carry-Over','2021-01-01','2022-09-30',75,'2022-05-26 11:11:07','No',NULL),(514,NULL,'BFAR-22-0013',2022,3,10,'Operation and maintenance of other fishery-related infrastructure and equipment','',1,15,NULL,2,'',5,'','Maintained','Current Year','2022-01-01','2022-12-31',12,'2022-06-03 14:22:55','No',NULL),(515,NULL,'BFAR-22-0014',2022,3,78,'Provision of Training and Technical Assistance','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-12-31',12,'2022-05-26 11:22:40','No',NULL),(516,NULL,'DTI-22-0003',2022,32,14,'Trainings and Seminars - SSF','Provision of trainings and seminars for the MSMEs under the Shared Service Fcaility Program of DTI.\r\n\r\nSSF Project is meant to improve MSME competitiveness by providing machinery, equipment, tools, systems, accessories, and other auxiliary items, skills, and knowledge under a shared system.  The facilities should help target beneficiaries increase their production capacities and improve product quality, resulting in increased markets, increased sales, and jobs generation.  SSF is a public-private partnership initiative being implemented through cooperators who can house the machinery and equipment and make these accessible to MSMEs.\r\n',1,36,NULL,2,NULL,5,'','Default','Current Year','2022-01-01','2022-12-31',75,'2022-05-26 11:38:57','No',NULL),(517,NULL,'',2022,NULL,NULL,'Community Empowerment thru Science and Technology','',1,31,NULL,2,'',4,'','Maintained','Current Year','2022-01-01','2022-12-31',NULL,'2022-05-26 11:51:02','Yes',NULL),(518,NULL,'',2022,NULL,NULL,'Distribution of Rice Combine Harvester','',1,9,NULL,2,'',5,'','Default','Current Year','2022-07-01','2022-07-31',NULL,'2022-05-26 11:52:07','Yes',NULL),(519,NULL,'DTI-22-0004',2022,32,15,'Trainings and Seminars - OTOP Program','ONE TOWN, ONE PRODUCT (OTOP) PHILIPPINES is a priority stimulus program for Micro, Small and Medium-scale enterprises (MSMEs) as government’s customized intervention to drive inclusive local economic growth. The program enables localities and communities to determine, develop, support, and promote products or services that are rooted in its local culture, community resource, creativity, connection, and competitive advantage. As their own ‘pride-of-place,’ these are offerings where they can be the best at or best renowned for. It endeavors to capacitate our ‘OTOPreneurs’ to innovate and produce market-ready products and services.',1,36,NULL,2,NULL,5,'','Default','Current Year','2022-01-01','2022-12-31',75,'2022-05-26 12:06:01','No',NULL),(520,NULL,'DA-22-0075',2022,22,1,'Provision of Rice Combine Harvester','',1,9,NULL,2,'',5,'','Default','Current Year','2022-07-01','2022-07-31',97,'2022-06-03 17:26:35','No',NULL),(522,NULL,'BFAR-22-0015',2022,3,NULL,'Establishment of Technology Demonstration project on Aquaculture and Postharvest','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-09-30',12,'2022-05-26 13:21:51','No',NULL),(523,NULL,'DTI-22-0005',2022,32,13,'Trainings and Seminars - Negosyo Center','he Negosyo Center Program is responsible for promoting ease of doing business and facilitating access to services for Micro, Small, and Medium Enterprises (MSMEs). Republic Act No. 10644 otherwise known as the “Go Negosyo Act,” seeks to strengthen MSMEs to create more job opportunities in the country.\r\n\r\nThe Program started in 2014, with 5 Centers established in the islands of Luzon, Visayas, and Mindanao. Since then, more Centers have been set up nationwide bringing ease of doing business closer to MSMEs in all regions. Negosyo Centers help stimulate entrepreneurship development as MSMEs contribute substantially in driving the Philippine economy.\r\n\r\nNegosyo Centers are found in strategic areas convenient for the existing and would-be entrepreneurs, such as DTI offices, Local Government Units (LGU), academe, Non-Government Organizations (NGOs), and malls.',1,36,NULL,2,NULL,5,'','Default','Current Year','2022-01-01','2022-09-30',75,'2022-05-26 13:22:10','No',NULL),(524,NULL,'BFAR-22-0016',2022,3,78,'Strengthening Partnership with Stakeholders ','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-09-30',12,'2022-06-02 12:20:29','No',NULL),(525,NULL,'BFAR-22-0017',2022,3,78,'Conduct of Information, Education, and Communication (IEC) activities','',1,15,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-12-31',12,'2022-05-26 13:40:03','No',NULL),(526,NULL,'BFAR-22-0018',2022,3,NULL,'Fisheries Production and Distribution','',3,26,NULL,2,'',5,'','Default','Current Year','2022-01-01','2022-12-31',12,'2022-06-02 17:23:24','No',NULL),(527,NULL,'DA-22-0032',2022,22,1,'Provision of Recirculating Dryer','',1,9,NULL,2,'',5,'','Default','Current Year','2022-07-01','2022-07-31',97,'2022-06-03 17:26:01','No',NULL),(528,NULL,'DTI-22-0006',2022,32,12,'Trainings - Kapatid Mentor ME (KMME) Program','Project KAPATID is an initiative of the DTI and the Philippine Center for Entrepreneurship (PCE) to help the country’s micro and small enterprises (MSEs) through three key components:\r\n\r\nThe Mentor ME (micro entrepreneurs) program, a coaching and mentoring approach where large corporations teach MSEs on different aspects of business operations\r\nThe Adopt-an-SSF (Shared Service Facility) program, which aims to help micro entrepreneurs by providing them access to SSFs in their community\r\nThe Inclusive Business (IB) model where MSEs are linked into large companies’ value chains\r\n\r\nThe Mentor ME program aims to:\r\n\r\nHelp micro and small entrepreneurs scale up their enterprises\r\nSpur economic activity and generate employment opportunities\r\nMainstream OTOPreneurs who are ready for business expansion\r\nIt features modules that shall subject the mentees to various business concepts and develop the acumen needed in scaling up and sustaining an enterprise:\r\n\r\nThe Entrepreneur, which discusses the mindset and values of a successful entrepreneur\r\nThe Enterprise, a seven-topic module covering the basic functional areas of an enterprise:\r\nProduct development\r\nMarketing\r\nOperations management\r\nAccounting\r\nTaxation\r\nFinance\r\nObligations and contracts\r\nSustaining the Enterprise, a four-topic module which focuses on sustainability amidst growth:\r\nHR management\r\nSupply and value chain\r\nSuccession planning\r\nBusiness plan development.',1,36,NULL,2,NULL,