,3,26,NULL,2,'',4,'','Default','Current Year','2022-02-01','2022-04-30',7,'2022-06-13 12:52:44','No',NULL),(658,NULL,'DA-22-0060',2022,22,3,'Provision of Incubator','The Livestock Program will provide 30 units of incubators with hatcher to registered Farmer Cooperatives and Association as assistance in their poultry enterprise. ',1,9,NULL,2,NULL,5,'','Default','Current Year','2022-06-01','2022-06-30',97,'2022-06-03 16:55:57','No',NULL),(660,NULL,'DOST-22-0005',2022,29,NULL,'Science, Technology and Innovation Assistance to DOST-1 Technology Transfer and Commercialization Projects (Community-Based Projects)','',1,31,NULL,2,'',4,'','Default','Current Year','2022-01-01','2022-12-31',28,'2022-07-13 16:42:12','No',NULL),(661,NULL,'DOST-22-0006',2022,29,NULL,'Science, Technology and Innovation Assistance to DOST-1 Technology Transfer and Commercialization Projects (Community-Based Projects)','',1,31,NULL,2,'',4,'','Default','Current Year','2022-01-01','2022-12-31',28,'2022-07-13 16:41:16','No',NULL),(662,NULL,'DOST-22-0007',2022,29,NULL,'Community Empowerment thru Science and Technology','',1,31,NULL,2,'',4,'','Maintained','Current Year','2022-01-01','2022-12-31',28,'2022-07-14 14:01:58','No',NULL),(663,NULL,'',2022,29,NULL,'Community Empowerment thru Science and Technology','',1,31,NULL,2,'',4,'','Maintained','Current Year','2022-01-01','2022-12-31',28,'2022-05-31 11:58:19','Yes',NULL),(664,NULL,'MGB-22-0004',2022,48,NULL,'Conduct of IEC to LGUs (IEC Campaign on Geohazard and VRA Maps)','IEC-VRA is a one-day training-workshop that includes lectures regarding the history of National Geohazard Mapping and Assessment Project (NGMAP), Vulnerability and Risk Assessment, the methodologies used for the conduct of the aforementioned projects and the output produced. It likewise introduces and provides additional technical information to the Local Government Authorities on Risk Exposure Assessment (REA) for a more efficient mainstreaming of Disaster Risk Management and sustainable development in the Philippines.\r\n\r\nThrough the lectures, round-table-discussions and post-IEC Assessment, participants were able to among others, understand the concepts on hazards, risk exposure, vulnerability, and Disaster Risk Reduction and Management (DRRM); understand the Risk Exposure Maps on Rain-induced Landslide and Flood; determine the risk exposure of the different barangays to various geohazard susceptibility ratings; and re-evaluate their Comprehensive Land Use Plan (CLUP), Comprehensive Development Plan (CDP) and Local DRRM Plan and develop appropriate contingency action plans based on the exposure maps.',2,7,NULL,2,'',4,'','Default','Current Year','2022-04-01','2022-10-30',77,'2022-05-31 13:02:39','No',NULL),(665,NULL,'MGB-22-0003',2022,48,NULL,'GROUNDWATER RESOURCE AND VULNERABILITY ASSESSMENT ','The objective of the project is to delineate areas with groundwater resource potential in the country, and identify the availability and physical quality of groundwater in various geologic formation/rock units. Furthermore, the project also aims to determine the likelihood of contaminants to reach a groundwater system from the ground surface to the aquifer. Outputs from the assessment may be utilized in the development of groundwater resource, land use management (zoning, screening, mitigating, monitoring) and promoting awareness of the importance of groundwater resources to locals.\r\n\r\nThe field survey in the target city/municipalities employed the use of Global Positioning System (GPS) and topographic map of the area to complete systematic survey spacing and collection of data such as well location, groundwater level and physical water quality test\r\n\r\nMeasurement of well depth and groundwater level is carried out with the use of a battery operated water level indicator that emits light and sound upon reaching the water surface. Water samples collected from pump wells and dug wells were subjected to water quality analysis using a portable Hanna Instrument meter and Hach meter. The in-situ test determines the temperature (T), pH, electric conductivity (Ec), total dissolved solids (TDS) and salinity (S) of the water sample. For all the target municipalities and city, the office conducted water level measurements and water sampling for the dry season and the wet season.\r\n',2,7,NULL,2,'',4,'','Default','Current Year','2022-02-01','2022-09-30',77,'2022-05-31 13:05:50','No',NULL),(666,NULL,'MGB-22-0006',2022,48,NULL,'Monitoring/Audit of Mining Permits/Contracts/Leases/Claims/JOAs (including those within Mineral Reservations) as to compliance with the Terms and Conditions/ Requirements and implementation of approved Work Program/Safety, Health, Environmental and Social Development Programs','permits are monitored relative to the physical and financial compliance of their approved Environmental Enhancement and Protection Programs/Annual Environmental Enhancement and Protection Programs, establishment of environmental funds and submission of periodic reports and tenement compliance',2,7,NULL,2,'',4,'','Default','Current Year','2022-01-01','2022-11-30',74,'2022-05-31 13:16:23','No',NULL),(667,NULL,'DA-22-0062',2022,22,3,'Implementation of Community-Based Swine Production, Repopulation and Expansion Through Farm Clustering and Consolidation','The Community-Based Swine Production, Repopulation and Expansion Through Farm Clustering and Consolidation is the Component 1 of Integrated National Swine Production Initiatives for Recovery and Expansion (INSPIRE) and clustered compartments shall adopt modern climate controlled building systems and Biosecurity Level 1 compliant facilities for disease resilience. It can be availed by Farmer Cooperatives and Associations.',1,22,NULL,2,NULL,5,'','Default','Current Year','2022-06-01','2022-12-31',97,'2022-06-03 16:50:57','No',NULL),(669,NULL,'DA-22-0064',2022,22,3,'Calibrated Repopulation-Implementation of Sentinel Protocol','Collaborative project of DA RFO I and Local Government Units thru the Municipal Agriculture Office which will be implemented region wide. Target beneficiaries are raisers 1 kilometer radius from the index case. They will be clustered composing of 15 individual raisers per cluster.',1,22,NULL,2,NULL,5,'','Default','Current Year','2022-06-01','2022-12-31',97,'2022-06-03 16:52:27','No',NULL),(670,NULL,'MGB-22-0005',2022,48,NULL,'Coastal Geohazard and Impact of Climate Change','The Coastal Vulnerability Assessment and Mapping Project of the Mines and Geosciences Bureau aims to address the issues and concerns relating to shoreline shift and relative sea level changes in areas identified as vulnerable to coastal geohazards and to formulate recommendations to mitigate and reduce the impact of the identified geohazards to the affected coastal communities. This project involves a one-year observation period, covering the Summer, Pre-monsoon and Post-monsoon seasons.\r\n\r\nAside from the geological and geohazard assessment of the areas, other relative data such as coastal habitat and marine life were also considered. Coastal Vulnerability Assessment utilized the Coastal Integrity Vulnerability Assessment Tool which has been designed to promote ecosystems-based management of the coast. Criteria for assessment shall include wave and sea level changes, intrinsic (slope, geomorphology, shoreline trends, coastal habitats) and extrinsic (beach mining, coastal management structures) characteristics to define the over-all state of the coast. \r\n',2,7,NULL,2,'',4,'','Default','Current Year','2022-03-01','2022-10-31',77,'2022-05-31 13:30:53','No',NULL),(674,NULL,'DA-22-0065',2022,22,1,'Improvement of Bugnay Diversion Dam','Demolition of existing structure and rehabilitation of ogee dam and canal lining',3,26,NULL,1,NULL,5,NULL,'Cumulative','Current Year','2022-03-28','2022-08-31',97,'2022-06-03 16:51:36','No',NULL),(675,NULL,'DA-22-0066',2022,22,1,'Construction of San Aurelio 1st Small Water Impounding Project (SWIP)','Construction of S