 Farm ','In support of the first strategy of the “One DA” approach of the Department of Agriculture which is the “farm clustering” aimed at establishing ‘Bayanihan-Agri clusters’ or BACs, the Rice Program will be establishing a Community Hybrid Rice cluster technology demonstration Farm.\r\n\r\n	Increased production per unit and reducing costs of production per kilogram are the major concerns. To be able to achieve these, the major strategy being implemented is the use of hybrid seeds which can increase production by 20-30%.\r\n	\r\nThus, the Community Hybrid Rice Farming is conceived in support of the achievement of the DA’s twin goal by developing a model that would promote wide-scale adoption of hybrid rice varieties in a community supported with extension and mechanization interventions to produce a volume of quality rice that would enable processing and marketing of the community’s own rice brand.\r\n\r\nProject components:  \r\n1.	All participating farmers shall be organized into sub-clusters. Each sub-cluster shall identify a hybrid rice variety for planting in the sub-cluster.\r\n2.	Crops may be established through mechanical transplanting or manual transplanting method using straight row planting. Further, all harvesting operations shall use mechanical equipment (combine harvester).\r\n3.	The provincial fertilizer recommendation derived from previous techno-demo shall be the basis of nutrient management with emphasis of balanced fertilization. Introduction of Bio-Prime Nano Fertilizer.\r\n4.	Use of mechanical dryer when available is preferred especially for Wet Season harvest but conventional sun drying can be practiced.\r\n5.	The association in the cluster shall be strengthened & shall be required to formulate an agri-enterprise plan for marketing of their produce.\r\n6.	All participating farmers shall be required to attend project briefing/s, harvest festivals and other related project activities.\r\n7.	Each cluster demo sites shall be required to be sustained for the succeeding cropping year.\r\n',1,9,NULL,2,NULL,5,'','Default','Current Year','2022-06-01','2023-03-31',97,'2022-06-03 16:43:14','No',NULL),(728,NULL,'DA-22-0080',2022,22,1,'Promotion of Good Agricultural Practices on Rice',' Good Agricultural Practices for Rice Production is primarily aimed at providing safe and quality rice to consumers. The focus is to reduce risks of pesticide contamination, anchored on the premise of awareness on and dissemination of food safety, hence, this training.\r\n \r\nProject components: \r\nA combination of theory and practice through lecture discussion, workshop and open forum will be employed. Reading materials will be distributed to participants to reinforce learning. There will be five (5) batches scheduled on the 2nd Quarter of CY 2022 and the remaining five (5) batches for the 4th Quarter of CY 2022.\r\n\r\n',1,9,NULL,2,NULL,5,'','Default','Current Year','2022-06-01','2022-11-30',97,'2022-06-03 16:58:56','No',NULL),(730,NULL,'DA-22-0081',2022,22,1,'Construction of Multi-Purpose Drying Pavement (MPDP)','Establishment of MPDP with a total area of 420 sq.m. at 150mm minimum thickness ',3,26,NULL,1,NULL,5,'','Default','Current Year','2022-07-01','2022-07-31',97,'2022-06-03 16:45:23','No',NULL),(732,NULL,'',2022,NULL,NULL,'Installation of Traffic CCTVs / Installation of CCTV','Installation of Traffic CCTVs',4,25,NULL,1,'',37,'N/A','Default','Current Year','2022-01-01','2022-12-01',NULL,'2022-06-02 14:39:53','Yes',NULL),(733,NULL,'UNP-22-0002',2022,73,NULL,'Establishment of Bamboo Innovation Research and Development Center','Two Storey Reinforced Concrete Building with total area of 851.15 sq.m.',1,31,NULL,1,'',5,'','Cumulative','Carry-Over','2021-03-08','2022-01-04',32,'2022-06-20 15:15:41','No',NULL),(734,NULL,'UNP-22-0002',2022,73,NULL,'Continuation of the Construction of Four-Storey Student Services Center','The Four Storey Building has a total floor area of 2,201.7sqm.',4,32,NULL,1,'',5,'','Cumulative','Carry-Over','2