ncial assistance for the continuing education of a qualified dependent, a livelihood activity of surviving members of the family to augment family income.\r\n\r\nEducational Assistance- intended for deceased OFW with school-age qualified dependent. The eldest or the first born shall be the qualified dependent, in cases where the eldest/first born is not qualified or able the next born child shall be elected. The assistance covers education assistance from primary (Kindergarten)- Php 5,000.00, secondary- Php 8,000.00 and tertiary- Php 10,000.00 education.',5,13,NULL,2,'',10,'','Cumulative','Current Year','2022-01-01','2022-12-31',41,'2022-06-07 16:51:13','No',NULL),(802,NULL,'OWWA-22-0008',2022,58,NULL,'Education and Livelihood Assistance Program for the Dependents of Deceased OFW Members (ELAP)  -	Livelihood Component','A program designed for survivors of deceased OFWs who were active OWWA members at the time of death and families of OFWs who are incarcerated/convicted and meted out the death penalty in foreign countries. It is intended to provide, aside from financial assistance for the continuing education of a qualified dependent, a livelihood activity of surviving members of the family to augment family income.',5,23,NULL,2,NULL,10,'','Default','Current Year','2022-01-01','2022-12-31',7,'2022-06-20 11:08:50','No',NULL),(804,NULL,'OWWA-22-0010',2022,58,NULL,'Balik Pinas, Balik Hanapbuhay (BPBH) Program','It is a cash assistance up to Php 20,000.00 given to active or non-active OWWA members who were: (1) Displaced by hostilities or wars/political conflicts, policy reforms or changes by host governments; (2) Victims of illegal recruitment or human trafficking or other distressful situations; (3) Distressed wards at the Migrant Workers and Overseas Filipinos Resource Centers who are due for repatriation; and (4) Repatriated OWWA-members who were employed by foreign employers which are beset with financial difficulties due to economic conditions.',5,23,NULL,2,NULL,10,'','Default','Current Year','2022-01-01','2022-12-31',41,'2022-06-07 17:09:51','No',NULL),(806,NULL,'OWWA-22-0012',2022,58,NULL,'Disability and Death Benefit  ','(1) Death and Disability Benefits:\r\n\r\n(i) Death Benefits. – A member shall be covered with life insurance for the duration of his or her employment contract. The coverage shall include one hundred thousand pesos (P100,000.00) for natural death and two hundred thousand pesos (P200,000.00) for accidental death;\r\n\r\n(ii) Disability and Dismemberment Benefits. – Disability and dismemberment benefits shall be included in a member’s life insurance policy, as provided for in the impediment schedule contained in the OWWA Manual of Systems and Procedures. The coverage is within the range of two thousand pesos (P2,000.00) to fifty thousand pesos (P50,000.00);\r\n\r\n(iii) Total Disability Benefit. – In case of total permanent disability, a member shall be entitled to one hundred thousand pesos (P100,000.00); and\r\n\r\n(iv) Burial Benefit. – A burial benefit of twenty thousand pesos (P20,000.00) shall be provided in case of the member’s death.\r\n',5,33,NULL,2,NULL,10,'','Default','Current Year','2022-01-01','2022-12-31',41,'2022-06-07 17:17:59','No',NULL),(808,NULL,'PIA-22-0002',2022,63,NULL,'Kapihan sa Ilocos”','The Kapihan sa Ilocos is a special communication project spearheaded by PIA Region 1 with the support from the different government agencies, government information officers, LGUs and government and private radio stations and a private production outfit. The topics during the Kapihan are related to health care programs, the recovery programs from the impact of the COVID-19 pandemic, the Balik Probinsya, Bagong Pag-asa (BP2) program, the PDP, the ELCAC, and the Ambisyon 2040.',3,11,NULL,1,'',5,'','Default','Current Year','2022-01-01','2022-12-31',4,'2022-06-13 09:57:12','No',NULL),(809,NULL,'PIA-22-0003',2022,63,NULL,'PIA 1 Radio Programs','The Philippine Information Agency, Region 1 (PIA R1) has partnered with  different radio stations in the four provinces of the region for establishing a regular weekly radio program. This is to boost the information and dissemination of government programs and projects related to health care, ELCAC, COVID-19 pandemic, the PDP, the Balik Probinsya, Bagong Pag-asa (BP2) program, and the Ambisyon2040.',3,11,NULL,2,'',5,'',NULL,'Current Year','2022-01-01','2022-12-31',85,'2022-06-10 22:45:57','No',NULL),(811,NULL,'PIA-22-0005',2022,63,NULL,'PIA 1 news production','The production and publication of news and feature releases will boost the information and dissemination of all programs and projects of the national and local government agencies  related to the ELCAC, the recovery programs against the impact of the COVID-19 pandemic, the Balik Probinsya, Bagong Pag-asa (BP2) program, the PDP, and the Ambisyon 2040. ',3,11,NULL,2,'',5,'N/A','Default','Current Year','2022-01-01','2022-01-01',85,'2022-06-10 23:20:55','No',NULL),(812,NULL,'PIA-22-0006',2022,63,NULL,'Information caravan','         The forum is a physical (face to face) or a virtual interaction with a particular sector of the society to discuss the updates on government programs related to  the ELCAC, the recovery programs from the impact of the COVID-19 pandemic, the Balik Probinsya, Bagong Pag-asa (BP2) program, the PDP and the Ambisyon 2040.\r\n \r\n',3,11,NULL,2,'',5,'N/A','Default','Current Year','2022-01-01','2022-12-31',85,'2022-06-10 23:48:55','No',NULL),(813,NULL,'PIA-22-0007',2022,63,NULL,'Multi-sectoral forum','The forum is a physical (face to face) or a virtual interaction with the various sectors of the society to discuss the updates on government programs related to the ELCAC, the recovery programs from the impact of the COVID-19 pandemic, the Balik Probinsya, Bagong Pag-asa (BP2) program, the PDP and the Ambisyon 2040.',3,11,NULL,2,'',5,'N/A','Default','Current Year','2022-01-01','2023-12-31',85,'2022-06-11 00:08:58','No',NULL),(814,NULL,'DPWH-22-0004',2022,