/*Table structure for table `project_exception` */

DROP TABLE IF EXISTS `project_exception`;

CREATE TABLE `project_exception` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `project_id` int(255) DEFAULT NULL,
  `year` int(4) DEFAULT NULL,
  `quarter` enum('Q1','Q2','Q3','Q4') DEFAULT NULL,
  `findings` text DEFAULT NULL,
  `causes` text DEFAULT NULL,
  `recommendations` text DEFAULT NULL,
  `submitted_by` int(255) DEFAULT NULL,
  `date_submitted` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `FK_project_exception_project` (`project_id`),
  CONSTRAINT `FK_project_exception_project` FOREIGN KEY (`project_id`) REFERENCES `project` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8mb4;

/*Data for the table `project_exception` */

insert  into `project_exception`(`id`,`project_id`,`year`,`quarter`,`findings`,`causes`,`recommendations`,`submitted_by`,`date_submitted`) values (3,275,2022,'Q1',NULL,'<p>Low % physical accomp was due to:</p>\r\n\r\n<p>1. conduct of other priority programs/intervening activities of the office (Regional ESWM Summit and Launching of Pinoy Basura Buster program) and</p>\r\n\r\n<p>2. lack of technical personnel</p>\r\n','<p>To be accomplished on 2nd Quarter; inclusive of Environmental Monitoring Officers (EnMOs) in assisting tech. personnel; and request for additional technical personnel for the SWM section to augment the compliance monitoring</p>\r\n',11,'2022-05-25 09:17:33'),(4,282,2022,'Q1',NULL,'<p>Low % physical accomp was due to:</p>\r\n\r\n<p>1. conduct of other priority programs/intervening activities of the office (Regional ESWM Summit and Launching of Pinoy Basura Buster program) and</p>\r\n\r\n<p>2. lack of technical personnel</p>\r\n','<p>To be accomplished on 2nd Quarter; inclusive of Environmental Monitoring Officers (EnMOs) in assisting tech. personnel; and request for additional technical personnel for the SWM section to augment the compliance monitoring</p>\r\n',11,'2022-05-25 09:17:33'),(5,288,2022,'Q2',NULL,'<p>revision of plan</p>\r\n','<p>submit change order</p>\r\n',71,'2022-05-25 09:34:08'),(6,278,2022,'Q1',NULL,'<p>Due to the increase/additional&nbsp; manpower for the quarter..</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>N/A</p>\r\n',80,'2022-05-25 10:03:13'),(7,329,2022,'Q2',NULL,'<p>Project delayed due to bad weather condition at the project site</p>\r\n','<p>Instruct the contractor to submit action plan to cope up with the negative slippage.</p>\r\n\r\n<p>Instruct the contractor to conduct overtime work to cope up with slippage.</p>\r\n',59,'2022-05-25 10:50:42'),(9,573,2022,'Q1',NULL,'<p>Student-beneficiaries &nbsp;are to be placed for employment starting in April 2022 or&nbsp;during their summer break/vacation&nbsp;based on the SPES Implementation Plan.</p>\r\n','<p>To monitor placement of the student-beneficiaries based on the approved pledges from Program Partners. It will be ensured that the the employment percentages indicated in the Implementation Plan will be followed.</p>\r\n',78,'2022-05-30 14:45:25'),(10,575,2022,'Q1',NULL,'<p>Strong linkages of the LGU - Public Employment Service Offices (PESO) to our local and governemnt employers.</p>\r\n','<p>Continuous facilitation of employment services by our PESOs.</p>\r\n',78,'2022-05-30 14:59:15'),(11,577,2022,'Q1',NULL,'<p>Three (3) projects released were classified as a group project with 1,161 members.</p>\r\n','<p>Continuous profiling&nbsp;of the beneficiaries in terms of their qulaifications as well as the susatainability and financial viability of the proposed livelihood projects.</p>\r\n',78,'2022-05-30 14:59:15'),(12,363,2022,'Q1',NULL,'<p>There was a change in BCDA&#39;s design (structural) which caused delay in the start of the construction of the structure.&nbsp;</p>\r\n','<p>Time extension was already requested by the contractor. BCDA&#39;s evaluation of the contract time extension request is ongoing.&nbsp;</p>\r\n',24,'2022-06-02 16:06:59'),(13,702,2022,'Q1',NULL,'<p>With recent instruction from TESDA Central Office that priority areas for Barangay Development Programs under ELCAC should be catered on or before June (Considering change in the Administration) and early start of 2022 scholarship implementation</p>\r\n','<p>Continuous implementation per plan.</p>\r\n',73,'2022-06-03 10:33:40'),(14,588,2022,'Q1',NULL,'<p>The target number of participants was limited to 30 in adherence to minimum public health standards and availability of funds. Moreover, the variance between the utilization and the allocated budget was attributed to the result of the procurement process conducted.</p>\r\n','<p>Due to the current pandemic situation, online platforms and blended learning should still be considered in the planning, budgeting and implementation of Programs, Projects and Activities (PPAs).</p>\r\n',29,'2022-06-06 16:33:01'),(15,627,2022,'Q1',NULL,'<p>The high accomplishment can be attributed to the high interest of the people to avail of the Handog Titulo Program having a lower cost of expenses as compared to other mode of titling. Further, different strategies and approaches were undertaken in accomplishing the Region&rsquo;s targets, as follows:</p>\r\n\r\n<p>1.&nbsp;One-stop-shop within the different Barangays were undertaken;</p>\r\n\r\n<p>2.&nbsp;IEC on applying for Free Patents were also undertaken thru the social media platforms. The Office posted on the DENR (PENRO) Facebook accounts the steps and requirements on how to apply for Free Patents. Moreover, the requirements, steps, and fees relative to the processing and issuance of Residential Free Patent was also posted in the DENR 1 website as part of the Citizen&#39;s Charter. The IEC&nbsp;helped in increasing the&nbsp;awareness of the citizen that their land once titled, they will be secured of their lots while economic value increases. They are also aware that these could be used as collateral for financing livelihood, educational and other uses.</p>\r\n\r\n<p>3.&nbsp;The lot survey project of the Office has resulted to great number of lots ready for titling applications;</p>\r\n\r\n<p>4. Strenthen collaboration with LGUs and with their support down to the Barangays or to the community level. During the patent drive, participants were informed of the benefits of having their lots titled and informed of the administrative fees being charged which is very minimal. With this, they were encouraged to apply title over their lands.</p>\r\n','<p>No recommendation.</p>\r\n',49,'2022-06-06 16:48:46'),(16,266,2022,'Q1',NULL,'<p>The only training center in Region 1, The Far East Maritime Training Center did not operate during the first quarter, thus there are only limited applicants who wish to apply for Skills upgrading located in Manila for various reasons.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seafarers who wish to avail of the program would like to enroll for the BASIC TRAINING COURSE, which is not included in the list of short term courses (should be upgrading skills and not basic skills).</p>\r\n','<p>Intensify program dissemination in the 2nd quarter in anticipation of the opening of the 2 seaports in Region 1, one in Currimao Ilocos Norte, and at Poro Point CSF LU. The identified hub for crew change is anticipated to be an avenue for OWWA Region 1 to promote the SUP.</p>\r\n',41,'2022-06-09 15:11:48'),(17,313,2022,'Q1',NULL,'<p>There is still a few number of Technical Vocational Institution who offers skills training at this time, including TESDA, where we endorse our clients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Those OWWA members with active status does not wish to apply to the program at the moment, and vice versa, those who wish to apply are with expired membership.</p>\r\n','<p>Schedule a consultation meeting to intensify program dissemination / marketing with partner TVIs regarding the scholarship offered by OFWs/ their dependents for a possible increase in enrollees.</p>\r\n',41,'2022-06-09 15:11:48'),(18,804,2022,'Q1',NULL,'<p>Due to travel restrictions, the conduct of FACE TO FACE EDT is also limited. On line EDT is not recommended due to the technicalities in their business proposal with financial presentation. The EDT is a pre requisite / eligibility requirement in order to avail of the program. There is a substantial number of applications where applicants cannot be reached thru their numbers provided.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Additionally, due to the demand of work to focus on the Hatid Sundo Operations of OWWA, various personnel who are in charge in the validation of proposed programs are the key players in the Hatid Sundo Operations, thus the delay in the validation / evaluation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Applicants are not fervent in complying to needed requirements despite coordination with the matter.</p>\r\n','<p>Augment other personnel from other unit to assist in the evaluation of application.</p>\r\n\r\n<p>The conduct of EDT will be implemented strategically by cluster due to the reduced Alert Level in the Region</p>\r\n',41,'2022-06-09 15:11:48'),(19,748,2022,'Q1',NULL,'<p>With the limited personnel in Pangasinan (only Pangasinan has this target) working on Field Survey documentation (FSD), they hardly covers the entire target for the period.&nbsp; the usual strategy that the province initiates is to&nbsp; create task force working with the entire target of the year.&nbsp;</p>\r\n','<p>create task force to work on the target</p>\r\n',99,'2022-06-13 14:23:45'),(20,750,2022,'Q1',NULL,'<p>Resolution of cases depends on the actual cases filed or recieved by the office not on the target. For January to March 2022, DAR is accomplished 100% of its caseload, meaning, all&nbsp;cases filed/recieved for the period has been resolved.</p>\r\n','<p>Information dissemination on the legal processes of DAR through the Agrarian Reform Justice on Wheels (ARJOW) program</p>\r\n',99,'2022-06-13 14:23:45'),(21,755,2022,'Q1',NULL,'<p>Usually, field offices is very dismal in recruiting new ARB-members in organization in the first quarter. Field offices focuses&nbsp;on the information dissemination on the advantages of membership in DAR assisted organizations/ cooperatives.&nbsp;Conduct&nbsp;of trainings and orientations.</p>\r\n','<p>Intensifies recruitment and info dissemination.</p>\r\n',99,'2022-06-13 14:23:45'),(22,376,2022,'Q2',NULL,'<p>Respective grantees&nbsp;has complied requirements ahead of the set deadline and was able to meet the minimum standards set.</p>\r\n','<p>The processing of funds were highly efficient with the payment of 15.25% more than the target set for the Commission.&nbsp;</p>\r\n',26,'2022-07-11 16:48:26'),(23,354,2022,'Q2',NULL,'<p><strong>Variation</strong>&nbsp;order&nbsp;and <strong>Suspension</strong> due to GSO supplies temporarily stored in the site (<em>Mabanag Hall</em>). The supplies present in the area cannot be moved immediately due to its volume and due to unavailability of other repository&nbsp;space.</p>\r\n','<p>Come up with a catch-up plan and fast track the completion of&nbsp;the project. The project is expected to&nbsp;complete&nbsp;on 3rd Quarter of 2022.</p>\r\n',89,'2022-07-14 08:23:39'),(24,375,2022,'Q2',NULL,'<p>The project schedule is <strong>delayed due to lack of supply of structural materials</strong> (<em>4 x 4 angle bars</em>) that resulted to variation/change order. In relation to the change in material specs, the structural design has undergone minor adjustments.</p>\r\n','<p>Come up with a catch-up plan and fast track the completion of&nbsp;the project.&nbsp;The project is expected to&nbsp;complete&nbsp;on 3rd Quarter of 2022.</p>\r\n',89,'2022-07-14 08:23:39'),(25,412,2022,'Q2',NULL,'<p>Fund released for CY 2022 was utilized to pay qualified unpaid Centenarians for CY 2019-2021 aside from the target Centenarians&nbsp;for the 2nd quarter.</p>\r\n','<p>Requested for fund augmentation from the Department of Budget and Management.&nbsp;</p>\r\n',45,'2022-07-15 10:22:43'),(26,425,2022,'Q2',NULL,'<p>The slippage was due to the influx of referrals from partners and stakeholders, especially during offsite payouts, and the numerous downloading of SAA to the Field Office.</p>\r\n','<p>No recommendation is required</p>\r\n',45,'2022-07-15 10:22:43'),(27,431,2022,'Q2',NULL,'<p>The slippage was due to the additional clients catered from the disaster-affected areas and the pandemic.</p>\r\n','<p>No recommendation is required</p>\r\n',45,'2022-07-15 10:22:43'),(28,238,2022,'Q2',NULL,'<p>The location of the site is above the offices of engineering, maintenance and motorpool section.</p>\r\n','<p>Make Suspension Order due to relocation of Engineering, Maintenance and Motorpool Offices</p>\r\n',21,'2022-07-15 12:41:13'),(29,564,2022,'Q2',NULL,'<p>The training uses a blended learning as modality and is not implemented on the original schedule&nbsp;due to unavailability of the training materials in the agency&#39;s Training Information Management System (IMS).</p>\r\n','<p>The section concerned has already coordinated the issue to the national office counterpart and has rescheduled the training on July.</p>\r\n',29,'2022-07-15 14:35:53'),(30,592,2022,'Q2',NULL,'<p>The Central Office has extended the original deadline of submission and correspondingly, the deadline of assessment is moved to close on July 31. &nbsp;</p>\r\n','<p>The Local Review Team are currently assessing the submitted entries and are still within the timeline of the new schedule.</p>\r\n',29,'2022-07-15 14:35:53'),(31,216,2022,'Q2',NULL,'<p>PPMC already granted two (2) time extensions. However, the Contractor on his own has stopped construction works. The Contract already expired last June 12, 2022 and the project is now subject to liquidated damages.&nbsp;&nbsp;</p>\r\n','<p>For the Contractor to fnish the remaining works the&nbsp;soonest possible time to minimize the liquidated damages.&nbsp;</p>\r\n',24,'2022-07-15 16:53:32'),(32,363,2022,'Q2',NULL,'<p>There was a change in BCDA&#39;s design (structural) which caused delay in the start of the construction of the structure.&nbsp;</p>\r\n','<p>Time extension was already requested by the contractor. BCDA&#39;s evaluation of the contract time extension request is ongoing.</p>\r\n',24,'2022-07-15 16:53:33'),(33,573,2022,'Q2',NULL,'<p>It can be attributed to the schedule of school break which falls from July to August, bywhich is the start of work engagement of the student-beneficiaries.</p>\r\n','<p>DOLE-RO1 has prepared SPES Implementation Plan by which all beneficiaries will be paid until September, thereby utilizing their wages in the upcoming enrollment period.</p>\r\n\r\n<p>As of June, accomplishment rate for SPES is 28% placing 689 beneficiaries while utilization rate is 22%.</p>\r\n\r\n<p>Cumulative payment schedule:<br />\r\nJuly - 44%&nbsp;<br />\r\nAugust - 87%<br />\r\nSeptember - 100%</p>\r\n',78,'2022-07-15 17:25:05'),(34,270,2022,'Q2',NULL,'<p>Some Scholarship Program will start in July 2022</p>\r\n','<p>Continuous implenting Program</p>\r\n',73,'2022-07-15 17:26:21'),(35,702,2022,'Q2',NULL,'<p>With recent instruction from TESDA Central Office that priority areas for Barangay Development Programs under ELCAC still be catered.</p>\r\n','<p>Continuous implenting Program</p>\r\n',73,'2022-07-15 17:26:21'),(36,575,2022,'Q2',NULL,'<p>The annual target of 478 beneficiaries to be served under the program with a total of P14.3M fund allocation was based on the P30K per capita for individual projects.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Considering that we also have group projects with which the maximum amount of assistance is dependent on the number of member beneficiaries (15-25 beneficiaries at a maximum of P250K; 26-50 beneficiaries at a maximum of P500K and 51 and above beneficiaries at a maximum of P1M) and not on a per capita basis, it is most likely that the number of beneficiaries will be relatively disproportionate to to the financial accomplishment.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As of June 30, 2022, the Region has already approved 12 group projects in the amount of P22.8M covering 2,525 beneficiaries. While for individual projects, we have approved 733 requests for livelihood assistance amounting to a total of P16.3M at a per capita of P22,279.34 per beneficiary.</p>\r\n','<p>It can be noted that the increase in the number of beneficiaries can significantly be attributed to the group projects.</p>\r\n',78,'2022-07-15 17:33:31'),(37,577,2022,'Q2',NULL,'<p>Strong linkages of the LGU - Public Employment Service Offices (PESO) to our local and governemnt employers.</p>\r\n','<p>Continuous facilitation of employment services by our PESOs.</p>\r\n',78,'2022-07-15 17:33:31'),(38,627,2022,'Q2',NULL,'<p>The high accomplishment can be attributed to the high interest of the people to avail of the Handog Titulo Program having a lower cost of expenses as compared to other mode of titling. Further, different strategies and approaches were undertaken in accomplishing the Region&rsquo;s targets, as follows:</p>\r\n\r\n<p>1.&nbsp;One-stop-shop within the different Barangays were undertaken;</p>\r\n\r\n<p>2.&nbsp;IEC on applying for Free Patents were also undertaken thru the social media platforms. The Office posted on the DENR (PENRO) Facebook accounts the steps and requirements on how to apply for Free Patents. Moreover, the requirements, steps, and fees relative to the processing and issuance of Residential Free Patent was also posted in the DENR 1 website as part of the Citizen&#39;s Charter. The IEC&nbsp;helped in increasing the&nbsp;awareness of the citizen that their land once titled, they will be secured of their lots while economic value increases. They are also aware that these could be used as collateral for financing livelihood, educational and other uses.</p>\r\n\r\n<p>3.&nbsp;The lot survey project of the Office has resulted to great number of lots ready for titling applications;</p>\r\n\r\n<p>4. Strenthen collaboration with LGUs and with their support down to the Barangays or to the community level. During the patent drive, participants were informed of the benefits of having their lots titled and informed of the administrative fees being charged which is very minimal. With this, they were encouraged to apply title over their lands.</p>\r\n','<p>While this activity is&nbsp;demand-driven,&nbsp;the universe and baseline shall be organized in order to come up with a reliable data in terms of the potential areas to be patented.</p>\r\n',49,'2022-07-18 16:38:29'),(39,628,2022,'Q2',NULL,'<p>The high accomplishment can be attributed to the high interest of the people to avail of the Handog Titulo Program having a lower cost of expenses as compared to other mode of titling. Further, different strategies and approaches were undertaken in accomplishing the Region&rsquo;s targets, as follows:</p>\r\n\r\n<p>1.&nbsp;One-stop-shop within the different Barangays were undertaken;</p>\r\n\r\n<p>2.&nbsp;IEC on applying for Free Patents were also undertaken thru the social media platforms. The Office posted on the DENR (PENRO) Facebook accounts the steps and requirements on how to apply for Free Patents. Moreover, the requirements, steps, and fees relative to the processing and issuance of Residential Free Patent was also posted in the DENR 1 website as part of the Citizen&#39;s Charter. The IEC&nbsp;helped in increasing the&nbsp;awareness of the citizen that their land once titled, they will be secured of their lots while economic value increases. They are also aware that these could be used as collateral for financing livelihood, educational and other uses.</p>\r\n\r\n<p>3.&nbsp;The lot survey project of the Office has resulted to great number of lots ready for titling applications;</p>\r\n\r\n<p>4. Strenthen collaboration with LGUs and with their support down to the Barangays or to the community level. During the patent drive, participants were informed of the benefits of having their lots titled and informed of the administrative fees being charged which is very minimal. With this, they were encouraged to apply title over their lands.</p>\r\n','<p>While this activity is&nbsp;demand-driven,&nbsp;the universe and baseline shall be organized in order to come up with a reliable data in terms of the potential areas to be patented.</p>\r\n',49,'2022-07-18 16:38:29'),(40,494,2022,'Q2',NULL,'<p>Delayed distribution was due to non completion of documentary requirements submitted &nbsp;by the propective recipients such as Certificate of Good standing, thus, other documents such as &nbsp;postmasterlist and csf for the equipment were not yet processed or signed prior to the distribution of the units</p>\r\n','<p>To fast-track submission of documents and distribution</p>\r\n',97,'2022-07-20 17:21:58'),(41,498,2022,'Q2',NULL,'<p>Delayed distribution was due to failure of bidding. No bidder signified intention to join the procurement. Stocks will be available this July-August.</p>\r\n','<p>To fast-track the procurement and distribution</p>\r\n',97,'2022-07-20 17:21:58'),(42,502,2022,'Q2',NULL,'<p>Ongoing distribution due to replacement of target FA beneficiaries thru recommendation of P/MLGU counterparts. FAs with updated Certificate of Good standing were selected /recommended to sustain the said project since it is implemented on a roll over scheme. And some of the targeted FAs has moved their planting scheduled to a later date thus pick-up of seeds from the DA stations were postponed.</p>\r\n','<p>To fast-track the distribution</p>\r\n',97,'2022-07-20 17:21:58'),(43,532,2022,'Q2',NULL,'<p>On-going distribution. Distribution were rescheduled this July as requested by the Local Chief Executives.</p>\r\n','<p>To fast-track the distribution</p>\r\n',97,'2022-07-20 17:21:58'),(44,534,2022,'Q2',NULL,'<p>On-going distribution. Distribution were rescheduled this July as requested by the Local Chief Executives.</p>\r\n','<p>To fast-track the distribution</p>\r\n',97,'2022-07-20 17:21:58'),(45,543,2022,'Q2',NULL,'<p>On-going distribution. Distribution were rescheduled this July as requested by the Local Chief Executives.</p>\r\n','<p>To fast-track the distribution</p>\r\n',97,'2022-07-20 17:21:58'),(46,619,2022,'Q2',NULL,'<p>Ongoing construction of retaining wall along the dam, ongoing construction of stone masonry on the downstream portion</p>\r\n','<p><strong>Close monitoring and supervision of the project progress and close coordination to the contractor</strong></p>\r\n',97,'2022-07-20 17:21:58'),(47,623,2022,'Q2',NULL,'<p>No ongoing construction activities; Recommended for rectification of non-conformities; Subjected for temination of contract due to incurrence of negative slippage of more than 15% during contract duration.</p>\r\n','<p>For approval of resolution by the contract termination review committee recomming project contract for the terminal</p>\r\n',97,'2022-07-20 17:21:58'),(48,642,2022,'Q2',NULL,'<p>Ongoing plastering of pump sump; And laying of distribution pipes.</p>\r\n','<p>Close monitoring and supervision of the project progress and close coordination to the contractor</p>\r\n',97,'2022-07-20 17:21:58'),(49,644,2022,'Q2',NULL,'<p>Mounting Structure and PV Module has been installed;&nbsp;<br />\r\nOngoing construction of slope protection and construction of sump.</p>\r\n','<p>Close monitoring and supervision of the project progress and close coordination to the contractor</p>\r\n',97,'2022-07-20 17:21:58'),(50,649,2022,'Q2',NULL,'<p>&nbsp;Deficiencies are caused bay insufficient semen straws from BAI due to damaged LN2 Plant.Note that LN2 is a significant component in maintaining processed semen straws.</p>\r\n','<p>Close coordination to BAI&nbsp;</p>\r\n',97,'2022-07-20 17:21:58'),(51,656,2022,'Q2',NULL,'<p>On-going validation of interested FCA recipients.</p>\r\n','<p>Close coordination to FCA recipients.</p>\r\n',97,'2022-07-20 17:21:58'),(52,667,2022,'Q2',NULL,'<p>Delayed implementation due to non completion&nbsp;of documentary requirements submitted &nbsp;by the small brothers and proposed sites for the project were not feasible.&nbsp;</p>\r\n','<p>Close coordination to FCA recipients to fast -track the completion of documentary requirements.</p>\r\n',97,'2022-07-20 17:21:58'),(53,669,2022,'Q2',NULL,'<p>Obligated amount is intended for the distribution of swine, feeds and vet drugs to sentinel sites in Pangasinan and Ilocos Norte; distribution will start once pertinent documents are completed.</p>\r\n','<p>To fast-track the procurement and distribution.</p>\r\n',97,'2022-07-20 17:21:58'),(54,675,2022,'Q2',NULL,'<p>Already fund transferred 90% of the total obligated amount to LGU-Balungao, Pangasinan;<br />\r\nFor issuance of Notice to Award c/o LGU</p>\r\n','<p>Close coordination with the LGU.</p>\r\n',97,'2022-07-20 17:21:58'),(55,677,2022,'Q2',NULL,'<p>For conduct of Pre-Construction Conference and lay-out and staking</p>\r\n','<p>Close monitoring and supervision of the project progress and close coordination to the contractor</p>\r\n',97,'2022-07-20 17:21:58'),(56,685,2022,'Q2',NULL,'<p>For evaluation of request for work suspension due to high water level at the pond area; The excavator might submerge during dredging&nbsp;</p>\r\n','<p>Close monitoring and supervision of the project progress and close coordination to the contractor</p>\r\n',97,'2022-07-20 17:21:58'),(57,726,2022,'Q2',NULL,'<p>On-going establishment for the wet season set-up: On-going delivery of input fertilizer</p>\r\n','<p>To fast-track the establishment and delivery of inputs.</p>\r\n',97,'2022-07-20 17:21:58'),(58,785,2022,'Q2',NULL,'<p>none</p>\r\n','<p>none</p>\r\n',97,'2022-07-20 17:21:58');

/*Table structure for table `project_expected_output` */

